        <Table striped>
          <thead>
            <tr>
              <th>Photo</th>
              <th>Name</th>
              <th>Alert</th>
            </tr>
          </thead>
          <tbody>
          </tbody>
        </Table></>
    );
  }
  
  function RiddleRow(props) {
    
    return(
      <Container>
      </Container>
    );
  }
  
  function RiddleData(props) {
  
    return(
      <Container>
      </Container>
    );
  }

export default MyPlants;
